import React from "react";

function Pricing() {
  return (
    <div className="container">
      <div classname="row">
        <div classname="col-4">
          <h1>Unbeatable pricing</h1>
        </div>
        <div classname="col-2"></div>
        <div classname="col-6"></div>
      </div>
    </div>
  );
}

export default Pricing;
